import{_ as e,o,c as a,O as r}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 4.1-322 Possession or consumption of alcoholic beverages by interdicted persons; penalty.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/4.1-322.md","filePath":"vacode/4.1-322.md"}'),t={name:"vacode/4.1-322.md"},n=r('<h1 id="§-4-1-322-possession-or-consumption-of-alcoholic-beverages-by-interdicted-persons-penalty" tabindex="-1">§ 4.1-322 Possession or consumption of alcoholic beverages by interdicted persons; penalty. <a class="header-anchor" href="#§-4-1-322-possession-or-consumption-of-alcoholic-beverages-by-interdicted-persons-penalty" aria-label="Permalink to &quot;§ 4.1-322 Possession or consumption of alcoholic beverages by interdicted persons; penalty.&quot;">​</a></h1><p>No person who has been interdicted pursuant to § <a href="http://law.lis.virginia.gov/vacode/4.1-333/" target="_blank" rel="noreferrer">4.1-333</a> or § <a href="http://law.lis.virginia.gov/vacode/4.1-334/" target="_blank" rel="noreferrer">4.1-334</a> shall possess any alcoholic beverages, except those acquired in accordance with subdivisions 1 through 5 of § <a href="http://law.lis.virginia.gov/vacode/4.1-200/" target="_blank" rel="noreferrer">4.1-200</a>, nor be drunk in public in violation of § <a href="http://law.lis.virginia.gov/vacode/18.2-388/" target="_blank" rel="noreferrer">18.2-388</a>.</p><p>Any interdicted person found to be in violation of this section shall be guilty of a Class 1 misdemeanor.</p><p>Code 1950, § 4-52; 1954, c. 484; 1982, c. 66; 1993, c. 866; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0717" target="_blank" rel="noreferrer">717</a>.</p>',4),s=[n];function i(c,l,p,d,h,_){return o(),a("div",null,s)}const g=e(t,[["render",i]]);export{v as __pageData,g as default};
